export default {
  name: 'ModalZoomImage',
  props: {
    src: {
      type: String,
      default: '',
    },
    visible: {
      type: Boolean,
      default: false,
    },
  },
  data() {
    return {
      isShow: this.visible,
    }
  },
  methods: {
    handleClose() {
      this.$emit('update:visible', false)
    },
  },
  watch: {
    visible(value) {
      this.isShow = value
    },
  },
}
